var LogType={Debug:"Debug",Info:"Info",Warning:"Warning",Error:"Error"};function logTypeToColour(a){switch(a){case LogType.Debug:a="green";break;case LogType.Info:a="blue";break;case LogType.Warning:a="yellow";break;case LogType.Error:a="red";break;default:a="white"}return a}
function log(a,c,b){if(b.enableLogs){var d=document.getElementById("logs");if(d){var e=logTypeToColour(a);a=a.substring(0,3).toUpperCase();var f=(new Date).toLocaleString();d.innerHTML+='<span style="color: '+e+'">['+f+"] ["+a+"] ["+c+"]</span><br>";b.logToConsole&&console.log(c)}}}function clearLogs(){var a=document.getElementById("logs");a&&(a.innerHTML="")}
function downloadLogs(){var a=document.getElementById("logs");if(a){var c="logs_"+(new Date).toJSON().slice(0,10)+".txt",b=document.createElement("a");b.setAttribute("href","data:text/plain;charset=utf-8,"+encodeURIComponent(a.innerHTML));b.setAttribute("download",c);b.style.display="none";document.body.appendChild(b);b.click();document.body.removeChild(b)}}
function openLogsInNewWindow(){var a=document.getElementById("logs");if(a){var c=window.open();c.document.open();c.document.write(a.innerHTML);c.document.close()}};
